import List from "./components/List";
import ListForm from "./components/ListForm";
import "./App.css";
function App() {
  const list = [
    {
      id: 1,
      task: "buy apples",
    },
    {
      id: 2,
      task: "wash car",
    },
  ];

  return (
    <div className="app">
      <div className="app-list">
        <div className="app-listform">
          <ListForm />
        </div>
        <div className="app-list-item">
          <List items={list}></List>
        </div>
      </div>
    </div>
  );
}

export default App;
